        public ReserveCopperPathOutput ReserveCopperPath(ReserveCopperPathInput input)
        {
            var output = new ReserveCopperPathOutput
            {
                DPId = 1,
                DPNumber = input.DPNumber,
                DPPortId = 1,
                DPPortNumber = "Port1",
                CabinetId = 1,
                CabinetNumber = "Cabinet1",
                CabinetPrimaryNumber = "Primary1",
                CabinetPrimaryPortId = 1,
                CabinetPrimaryPortNumber = "Primary1Port1",
                CabinetSecondaryNumber = "Secondary1",
                CabinetSecondaryPortId = 1,
                CabinetSecondaryPortNumber = "Secondary1Port1",
                MDFId = 3,
                MDFNumber = "MDF 1",
                MDFHorizontalNumber = "Horizontal1",
                MDFHorizontalPortId = 9,
                MDFHorizontalPortNumber = "Horizontal1Port1",
                MDFVerticalNumber = "Vertical1",
                MDFVerticalPortId = 9,
                MDFVerticalPortNumber = "Vertical1Port1"
            };

            if(input.ReserveTelephony)
            {
                output.SwitchId = 2;
                output.SwitchNumber = "Switch1";
                output.SwitchCardNumber = "Card1";
                output.SwitchSlotNumber = "Slot1";
                output.SwitchDeviceId = 5;
                output.SwitchDeviceNumber = "Device1";
            }

            if(input.ReserveData)
            {
                output.DSLAMId = 1;
                output.DSLAMNumber = "DSLAM11";
                output.DSLAMFrameNumber = "DSLAMFRAME11";
                output.DSLAMCardNumber = "DSLAMCARD11";
                output.DSLAMPortId = 1;
                output.DSLAMPortNumber = "DSLAMPort11";
            }

            return output;
        }

        public ReserveFreePortOutput ReserveFreePort(ReserveFreePortInput input)
        {
            return new ReserveFreePortOutput
