                PortId = 1,
                PortNumber = input.PortTypeName + "001",
                NodeParts = new List<ReserveFreePortOutputNodePart>
                {
                    new ReserveFreePortOutputNodePart
                    {
                        NodePartTypeName = "Part Type 1",
                        NodePartNumber = "PartType001"
                    },
                    new ReserveFreePortOutputNodePart
                    {
                        NodePartTypeName = "Part Type 2",
                        NodePartNumber = "PartType002"
                    }
                }

            };
        }
    }

